INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 7001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 7, 106001, 1, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 7002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 7, 105901, 1, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 7003, "2030/12/17 14:59:59", 0.0, 0.0, 0, 7, 105801, 1, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 10001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 10, 105801, 1, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 10002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 10, 106001, 1, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 10003, "2030/12/17 14:59:59", 0.0, 0.0, 0, 10, 105901, 1, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シェフィ", 10004, "2030/12/17 14:59:59", 0.0, 0.0, 2104010, 10, 106401, 1, 0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 12001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 12, 105801, 1, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, -416.5, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 13001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 13, 106001, 1, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 13002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 13, 105901, 1, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シェフィ", 13003, "2030/12/17 14:59:59", 0.0, 0.0, 2104010, 13, 106401, 1, 0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 13004, "2030/12/17 14:59:59", 0.0, 0.0, 0, 13, 105801, 1, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 14001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 14, 105901, 1, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シェフィ", 14002, "2030/12/17 14:59:59", 0.0, 0.0, 2104010, 14, 106401, 1, 0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 14003, "2030/12/17 14:59:59", 0.0, 0.0, 0, 14, 105801, 1, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 14004, "2030/12/17 14:59:59", 0.0, 0.0, 0, 14, 106001, 1, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 15001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 15, 105901, 1, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, -470.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シェフィ", 16001, "2030/12/17 14:59:59", 0.0, 0.0, 2104010, 16, 106401, 1, 0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 16002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 16, 105801, 1, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 16003, "2030/12/17 14:59:59", 0.0, 0.0, 0, 16, 106001, 1, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 16004, "2030/12/17 14:59:59", 0.0, 0.0, 0, 16, 105901, 1, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 17002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 17, 105901, 1, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 17004, "2030/12/17 14:59:59", 0.0, 0.0, 0, 25, 106001, 1, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 17005, "2030/12/17 14:59:59", 0.0, 0.0, 0, 25, 105901, 1, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シェフィ", 17006, "2030/12/17 14:59:59", 0.0, 0.0, 2104010, 25, 106401, 1, 0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 17007, "2030/12/17 14:59:59", 0.0, 0.0, 0, 25, 105801, 1, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 18001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 18, 190801, 1, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 18002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 18, 190801, 2, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 19001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 19, 190801, 3, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, -470.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 19002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 19, 190801, 4, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, -470.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 20001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 20, 190801, 5, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, -470.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 20002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 20, 190801, 6, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, -470.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 21001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 21, 106001, 1, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 21002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 21, 105901, 1, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シェフィ", 21003, "2030/12/17 14:59:59", 0.0, 0.0, 2104010, 21, 106401, 1, 0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 21004, "2030/12/17 14:59:59", 0.0, 0.0, 0, 21, 105801, 1, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 22001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 22, 190801, 1, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, -430.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 22002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 22, 190801, 2, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, -430.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 23001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 23, 190801, 3, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, -430.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 23002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 23, 190801, 4, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, -430.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24001, "2030/12/17 14:59:59", 4.08, 8.0, 0, 24, 109001, 1, 10011, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24002, "2030/12/17 14:59:59", 5.0, 8.0, 0, 24, 109001, 2, 10011, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24003, "2030/12/17 14:59:59", 10.11, 8.0, 0, 24, 109001, 3, 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24004, "2030/12/17 14:59:59", 4.0, 8.0, 0, 24, 109001, 4, 10011, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24005, "2030/12/17 14:59:59", 6.0, 8.0, 0, 24, 109001, 5, 10011, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24006, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109002, 6, 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24007, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109002, 7, 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24008, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109002, 8, 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24009, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109002, 9, 10011, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("エリコ（バレンタイン）", 24010, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109002, 10, 10011, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24011, "2030/12/17 14:59:59", 2.12, 8.0, 0, 24, 109101, 1, 10011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24012, "2030/12/17 14:59:59", 4.19, 8.0, 0, 24, 109101, 2, 10011, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24013, "2030/12/17 14:59:59", 2.3, 8.0, 0, 24, 109101, 3, 10011, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, -385.0, "2019/01/31 12:00:00", 4);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24014, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109102, 4, 10011, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24015, "2030/12/17 14:59:59", 5.23, 8.0, 0, 24, 109101, 5, 10011, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24016, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109102, 6, 10011, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24017, "2030/12/17 14:59:59", 5.01, 8.0, 0, 24, 109101, 7, 10011, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, -385.0, "2019/01/31 12:00:00", 2);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24018, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109102, 8, 10011, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24019, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109102, 9, 10011, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シズル（バレンタイン）", 24020, "2030/12/17 14:59:59", 0.0, 0.0, 0, 24, 109102, 10, 10011, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 0.0, "2019/01/31 12:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シェフィ", 26001, "2030/12/17 14:59:59", 0.0, 0.0, 2104010, 26, 106401, 1, 0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 2, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 26002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 26, 105801, 1, 0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 26003, "2030/12/17 14:59:59", 0.0, 0.0, 0, 26, 106001, 1, 0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 26004, "2030/12/17 14:59:59", 0.0, 0.0, 0, 26, 105901, 1, 0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("シェフィ", 27001, "2030/12/17 14:59:59", 0.0, 0.0, 2104010, 27, 106401, 1, 0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 2, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("ペコリーヌ", 27002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 27, 105801, 1, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 27003, "2030/12/17 14:59:59", 0.0, 0.0, 0, 27, 106001, 1, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 27004, "2030/12/17 14:59:59", 0.0, 0.0, 0, 27, 105901, 1, 0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("カリン", 28001, "2030/12/17 14:59:59", 0.0, 0.0, 0, 28, 190801, 1, 0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 1, -363.0, "2019/09/24 15:00:00", 1);
