INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("コッコロ", 43002, "2030/12/17 14:59:59", 0.0, 0.0, 0, 43, 105901, 1, 0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("キャル", 43003, "2030/12/17 14:59:59", 0.0, 0.0, 0, 43, 106001, 1, 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, -363.0, "2015/12/17 15:00:00", 1);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES ("アメス", 43004, "2030/12/17 14:59:59", 0.0, 0.0, 0, 44, 123001, 1, 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, -416.5, "2015/12/17 15:00:00", 1);
